import React, {Component} from 'react';
import {Button, Card, Collapse,Table} from "antd";
import img_OA from '../../images/production/OA.jpg';
import cardStyle from './index.module.css';
import {DESCRIBE_OA} from "../../constant";
import ProductionCenter from "../../pages/ProductionCenter";
import PriceCard from "../PriceCard";

const {Meta} = Card;
const {Panel} = Collapse;

class Product extends Component {

    render() {

        return (
            <Collapse accordion defaultKey={[1]}>
                <Panel header='OA系统'>
                    <PriceCard/>
                </Panel>
            </Collapse>
        );
    }
}

export default Product;
